drop table if exists #Input

select r.ordinal RowID, r.[value] Val
into #Input
from string_split(replace(@Input, 'mul(', char(7)), char(7), 1) r

select sum(cast(n1 as int) * cast(n2 as int)) Answer1
from #Input
	cross apply (select charindex(')', Val, 1) ind1) i
	cross apply (select left(Val, Ind1 - 1) Val1) v
	cross apply (select charindex(',', Val1, 1) ind2) i1
	cross apply (select left(Val1, ind2 - 1) n1, substring(Val1, ind2 + 1, 100) n2) i2
where ind1 > 0
	and ind2 > 0
	and n1 not like '%[^0-9]%'
	and n2 not like '%[^0-9]%'

;with dd as
	(select RowID, iif(ind1 > 2 and ind1 > ind2, 1, 0) Do
		from #Input
			cross apply (select charindex('do()', Val, 1) ind1
								, charindex('don''t()', Val, 1) ind2
						) i1
		where Val like '%do()%'
			or Val like '%don''t()%'
		union all
		select 0, 1
	)
select sum(do * cast(n1 as int) * cast(n2 as int)) Answer2
from #Input inp
	cross apply (select charindex(')', Val, 1) ind1) i
	cross apply (select left(Val, Ind1 - 1) Val1) v
	cross apply (select charindex(',', Val1, 1) ind2) i1
	cross apply (select left(Val1, ind2 - 1) n1, substring(Val1, ind2 + 1, 100) n2) i2
	cross apply (select top 1 Do
					from dd
					where dd.RowID < inp.RowID
					order by dd.RowID desc
				) d
where ind1 > 0
	and ind2 > 0
	and n1 not like '%[^0-9]%'
	and n2 not like '%[^0-9]%'